import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getNyc } from '../actions/getNyc';
import { getGaurdian } from '../actions/getGaurdian';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import DataCard from './DataCard';

const DataView = ({ getNyc, getGaurdian, gaurdianData }) => {
	useEffect(() => {
		return () => {
			getNyc();
			getGaurdian();
		};
	}, [getNyc(), getGaurdian()]);
